import './about_us.css'

export default function AboutUs(){
    return(
        <div>
            <img className="about-us-img" src="./img/aboutus.jpg"/>
            <h3 className="about">About Us</h3>
            <p className="about-text">Mercedes-Benz USA is committed to Driving Your Future, our corporate social responsibility program designed to empower the next generation. Through partnerships with nonprofit organizations Junior Achievement USA® and Safe Kids Worldwide®, the initiative supports educational programs around technology and sustainability, career readiness, and child and teen injury prevention. Learn more about our community impact through our 2022 Social Responsibility Impact Report.</p>
        </div>
    )
}
